def find_SMA(symbol):
    # "https://www.alphavantage.co/query?function=SMA&symbol=MSFT&interval=weekly&time_period=10&series_type=open&apikey=demo"
    retstr = "https://www.alphavantage.co/query?function=SMA&symbol={0}&interval=daily&time_period=10&series_type=close&apikey={1}".format(symbol, API_KEY)
    req = requests.get(retstr)
    temp = req.json()
    stuff = []
    # print(temp)
    ctr = 0
    for key in temp["Technical Analysis: SMA"]:
        if ctr < 253:
            stuff.insert(0, temp["Technical Analysis: SMA"][key]["SMA"])
            ctr += 1
        else:
            break
    return stuff

