def find_stock(symbol):
    retstr = "https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol={0}&apikey={1}".format(symbol, API_KEY3)
    req = requests.get(retstr)
    temp = req.json()
    retdict = {}
    # print(temp)
    temp = temp['Global Quote']
    retdict["symbol"] = temp["01. symbol"]
    retdict["open"] = temp["02. open"]
    retdict["high"] = temp["03. high"]
    retdict["low"] = temp["04. low"]
    retdict["price"] = temp["05. price"]
    retdict["volume"] = temp["06. volume"]
    retdict["previous_close"] = temp["08. previous close"]
    retdict["change"] = temp["09. change"]
    retdict["change_percent"] = temp["10. change percent"]
    return(retdict)
    
